    name: "b",
    status: [
        { age: 29, closed: true},
        { age: 5, closed: false},
    ]
}
</code></pre>

<p>I want to check if the before last object in status has for example age = 29.<br>
so for that i have this working query:</p>

<pre><code>db.col.find({
    $expr: {
        $eq: [
            29,
            {
                $let: {
                    vars: { beforeLast: { $arrayElemAt: [ "$status", -2 ] } },
                    in: "$$beforeLast.age"
                }
            }
        ]
    }
})
</code></pre>

<p>but i want now to check for example if age contain a value like "2". i need to use regex expression. is there anyway to convert that query to use regex inside/instead <code>$eq</code> operator ?<br>
<strong>PS: i don't want to use aggregation because i'm working with an old version.</strong></p>

