{
    "_id" : "2018-03-08",
    "count" : 1.0
}
</code></pre>

<p>Now, im trying to reproduce this result on my .NET MVC project and I'm facing difficult to translate the substring to C#.</p>

<p><strong>C# CODE</strong></p>

<pre><code>var connString = "mongodb+srv:";
var client = new MongoClient(connString);
