Mongoose how to update multiple subdocuments in different documents in one call - MERN stack<p>I want to make an API call via mongoose to update the date field of a batch of selected <code>Players</code> (schema below) <code>cards</code> subdocument to the current date.</p>

<p>The Player schema:</p>

<pre><code>const playerSchema = new Schema({
  name: String,
  cards: [{
    date: { type: Date, required: true },
    note: String
  }],
});
</code></pre>

<p>I created a checkbox where a user can select multiple <code>Players</code> (along with a specific 'card' subdocument from their <code>cards</code> array) and change the dates to be the same for those specific cards for all the selected <code>Players</code>. In react, I batched the corresponding ObjectIds together in the body and am sending the selected player/card combos in an array of objects that look as follows (where the number indicates the same grouped player &amp; card subdocument ObjectId):</p>

<p>The array that I am sending to the server (accessible via req.body.cards):</p>

<pre><code>[ {cardId: card1._id, playerId: player1._id},
  {cardId: card2._id, playerId: player2._id},
  {cardId: card3._id, playerId: player3._id} ]
</code></pre>

<p>In my Node/Express server <code>put</code> route, how would I go about updating all of those players and their specific card and giving them all the same date (Date.now()) asynchronously? In other words, how would I properly iterate over all the different playerIds and their respective cardId (preferably without any external libraries)?</p>

<p>Here's how I am updating a single card for a single player in my regular put route for editing the <code>cards</code> subdocument:</p>

<pre><code>Player.findById(playerId)
  .then(player =&gt; {
    const card = player.cards.id(cardId);
    card.date = Date.now();

    player.save(
      (err, updatedCard) =&gt;
        err
          ? console.log("Error in update card: " + err)
          : res.send(updatedCard)
    );
  })
  .catch(err =&gt; res.status(404).json({ success: false }));
</code></pre>

