MongoDB Comparing Dates Inconsistently Working<p>I have a chunk of code in mongoDB / javascript that is sometimes working, but other  times not. When I go to compare dates, this code works:</p>

<pre><code>    let year = new Date().getFullYear();
    User.aggregate([ 
        { $match: { emplyID: Number(req.params.emplyID) } },
        { $match: { "dateReq": { $gte: new Date(year, 0, 1), $lt: new Date(year+1, 0, 1) } } }
 ], function (err, pto) {
console.log(pto.length)
 }
</code></pre>

<p>Console log results = 2</p>

<p>However, this does not work:</p>

<pre><code>let year = new Date().getFullYear();
    User.aggregate([ 
        { $match: { emplyID: Number(req.params.emplyID) } },
        { $match: { "dateReq": { $gte: new Date(year - 1, 0, 1), $lt: 
new Date(year, 0, 1) } } }
 ], function (err, pto) {
console.log(pto.length)
 }
</code></pre>

<p>The console log is always equal to 0. </p>

<p>In the current DB, these objects exist:</p>

<p>DateReq : 3/9/19,
DateReq : 3/8/19,
DateReq : 10/20/18,
DateReq: 11/15/18</p>

<p>The first function is supposed to count the number of entries that exist between 2018 and 2019, and does it correctly, finding two items. The second function is supposed to count the number of entries that exist between 2017 and 2018, but even though the data exists, it can not be found. Any ideas what might be going wrong here?</p>

