Reference within MongoDB/Morphia<p>I found this <a href="https://stackoverflow.com/questions/5373198/mongodb-relationships-embed-or-reference">post</a> where it is discussed if references between documents should be established. I want to annotate my <code>Java</code> class so that references within <code>JSON</code> documents are created:</p>

<pre><code>{
    "id": "3",
    "bs": [
        {
            "name": "abc"
        },
        {
            "name": "def",
            "preconditions": ["abc"]
        },
        {
            "name": "ghi",
            "preconditions":  ["abc"]
        }
    ]
}
</code></pre>

<p>Here the objects of the list preconditions have references to objects of the list bs. Is that possible in <code>MongoDB</code>? How is it called (I was unable to find any information using the keywords "embedded reference" and "reference within documents".) How would a solution look like with <a href="https://morphia.dev/" rel="nofollow noreferrer">morphia</a>?</p>

<p>EDIT:I know the <a href="https://morphia.dev/1.4/guides/annotations/#reference" rel="nofollow noreferrer">reference</a> annotation but it seems to refernce to anoter collection and not to a list of objects in the same document. I just want to ensure, that the serialized java objects are deserialized correctly (both attributes should become references to the same object).</p>

<p>EDIT II: To clarify my problem I provide the code which I used for testing:</p>

<p>Class A</p>

<pre><code>@Entity("MyAs")
public class A {
    @Id
    public String name;

    @Embedded
    public List&lt;B&gt; bs=new LinkedList&lt;B&gt;();
}
</code></pre>

<p>Class B</p>

<pre><code>public class B {
    @Id
    public String bName;

    public List&lt;B&gt; preconditions=new LinkedList&lt;B&gt;(); 
}
</code></pre>

<p>In my main method I do the following:</p>

<pre><code>final Datastore datastore = morphia.createDatastore(new MongoClient(), 
"Test");
B b1=new B();
b1.bName="b1";

B b2=new B();
b2.bName="b2";

b1.preconditions.add(b2);

List&lt;B&gt; bs=new LinkedList&lt;B&gt;();
bs.add(b1);
bs.add(b2);

A a1=new A();
a1.name="mya1";
a1.bs=bs;

datastore.save(a1);

A myA=datastore.get(A.class,"mya1");
System.out.println(myA.bs.get(0).preconditions.get(0));
System.out.println(myA.bs.get(0).preconditions.get(0).hashCode()+" --"  +myA.bs.get(0).preconditions.get(0).bName);
System.out.println(myA.bs.get(1));
System.out.println(myA.bs.get(1).hashCode() +" --" +  myA.bs.get(1).bName);
</code></pre>

<p>This leads to the following structure in Mongo DB Compass (obviously, no reference is created):
<a href="https://i.stack.imgur.com/Idp4G.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Idp4G.png" alt="enter image description here"></a></p>

<p>If the document is deserialized then (with datastore.get), obviously two separate objects are created for b2 (outputs of <code>System.out.println</code>):</p>

<pre><code>mongotest.B@78b729e6
2025269734 --b2
mongotest.B@6b4a4e18
1800031768 --b2
</code></pre>

<p>I want to have a structure where the b2 object in preconditions references to the b2 object in bs!</p>

<p>If I do <code>datastore.get(A.class,"mya1");</code> I want to have the same structure which I used for  the serialization: a single B object which is referenced in the bs list and in the preconditions..</p>

